import React from 'react'
import{HeroContainer,HeroBg,VideoBg} from './Hero'
import Video from '../../video/video.mp4'
function Hero() {
    return (
        <>
        <HeroContainer id="home">
            <HeroBg>
                <VideoBg autoplay loop muted src={Video}
                type='video/mp4'/>
            </HeroBg>
            </HeroContainer>    
        </>
    )
}

export default Hero
